"use strict";(self.webpackChunktestdocumentation=self.webpackChunktestdocumentation||[]).push([[734],{8462:e=>{e.exports=JSON.parse('{"version":{"pluginId":"default","version":"current","label":"Next","banner":null,"badge":false,"noIndex":false,"className":"docs-version-current","isLast":true,"docsSidebars":{"tutorialSidebar":[{"type":"link","label":"Introduction","href":"/DevelopmentDocumentation/docs/intro","docId":"intro","unlisted":false},{"type":"category","label":"General Concepts","collapsible":true,"collapsed":true,"items":[{"type":"link","label":"Setting Up Your Project","href":"/DevelopmentDocumentation/docs/general-concepts/settingupudon","docId":"general-concepts/settingupudon","unlisted":false},{"type":"link","label":"Adding Images and Creating Sprites","href":"/DevelopmentDocumentation/docs/general-concepts/unityspriteconversion","docId":"general-concepts/unityspriteconversion","unlisted":false},{"type":"link","label":"Setting Up Post Processing","href":"/DevelopmentDocumentation/docs/general-concepts/postprocessing","docId":"general-concepts/postprocessing","unlisted":false},{"type":"link","label":"Multi-Language Support with Fonts in Unity 2019","href":"/DevelopmentDocumentation/docs/general-concepts/multilingualsupport","docId":"general-concepts/multilingualsupport","unlisted":false}],"href":"/DevelopmentDocumentation/docs/category/general-concepts"},{"type":"category","label":"Udon","collapsible":true,"collapsed":true,"items":[{"type":"link","label":"Hash Studios Water","href":"/DevelopmentDocumentation/docs/udon/hashstudioswater","docId":"udon/hashstudioswater","unlisted":false},{"type":"link","label":"Hash Studios AdFlux","href":"/DevelopmentDocumentation/docs/udon/hashstudiosadflux","docId":"udon/hashstudiosadflux","unlisted":false},{"type":"link","label":"ParGUI","href":"/DevelopmentDocumentation/docs/udon/pargui","docId":"udon/pargui","unlisted":false},{"type":"link","label":"Hash Studios Translate","href":"/DevelopmentDocumentation/docs/udon/hashstudiostranslate","docId":"udon/hashstudiostranslate","unlisted":false},{"type":"link","label":"Hash Studios DoorSys","href":"/DevelopmentDocumentation/docs/udon/hashstudiosdoorsys","docId":"udon/hashstudiosdoorsys","unlisted":false},{"type":"link","label":"Hash Studios Player Scanner","href":"/DevelopmentDocumentation/docs/udon/hashstudiosplayerscanner","docId":"udon/hashstudiosplayerscanner","unlisted":false},{"type":"link","label":"Hash Studios Portal Picker","href":"/DevelopmentDocumentation/docs/udon/hashstudiosportalpicker","docId":"udon/hashstudiosportalpicker","unlisted":false},{"type":"link","label":"Hash Studios Season Changer","href":"/DevelopmentDocumentation/docs/udon/hashstudiosseasonchanger","docId":"udon/hashstudiosseasonchanger","unlisted":false},{"type":"link","label":"Hash Studios SimuLogo","href":"/DevelopmentDocumentation/docs/udon/hashstudiossimulogo","docId":"udon/hashstudiossimulogo","unlisted":false},{"type":"link","label":"Hash Studios World Disclaimer","href":"/DevelopmentDocumentation/docs/udon/hashstudiosworlddisclaimer","docId":"udon/hashstudiosworlddisclaimer","unlisted":false}],"href":"/DevelopmentDocumentation/docs/category/udon"},{"type":"category","label":"Shaders","collapsible":true,"collapsed":true,"items":[{"type":"link","label":"Installing Shader Graph for Unity","href":"/DevelopmentDocumentation/docs/shaders/settingupshadergraph","docId":"shaders/settingupshadergraph","unlisted":false}],"href":"/DevelopmentDocumentation/docs/category/shaders"}]},"docs":{"general-concepts/multilingualsupport":{"id":"general-concepts/multilingualsupport","title":"Multi-Language Support with Fonts in Unity 2019","description":"Font Limitation: As of 06/10/2024, you cannot dynamically change fonts within Udon scripts in Unity 2019 or Unity 2022. Therefore, you need to set up font switching manually.","sidebar":"tutorialSidebar"},"general-concepts/postprocessing":{"id":"general-concepts/postprocessing","title":"Setting Up Post Processing","description":"Post processing is an essential tool in Unity that enhances the visual quality of your scenes by applying effects such as bloom, color grading, and depth of field. This guide will walk you through the process of setting up post processing and adding it to your camera.","sidebar":"tutorialSidebar"},"general-concepts/settingupudon":{"id":"general-concepts/settingupudon","title":"Setting Up Your Project","description":"To use our Udon-based prefabs, you need to set up the VRChat Creator Companion with UdonSharp. This guide provides a brief overview of the process, with direct links to the relevant VRChat documentation for detailed instructions.","sidebar":"tutorialSidebar"},"general-concepts/unityspriteconversion":{"id":"general-concepts/unityspriteconversion","title":"Adding Images and Creating Sprites","description":"Sprite Conversion: You will likely need to convert your images to sprites to add them to most of our prefabs.","sidebar":"tutorialSidebar"},"intro":{"id":"intro","title":"Introduction","description":"Welcome to Hash Studios! We specialize in providing top-notch prefabs for VRChat world developers. Our prefabs come with specific requirements and setups, and this documentation is here to make your life easier by guiding you through each step.","sidebar":"tutorialSidebar"},"shaders/settingupshadergraph":{"id":"shaders/settingupshadergraph","title":"Installing Shader Graph for Unity","description":"Some of our prefabs may require Shader Graph to use them since it makes our development easier and allows you as a creator to edit them more easily. This guide will walk you through the process of installing Shader Graph in Unity and how to use it with our prefabs.","sidebar":"tutorialSidebar"},"udon/hashstudiosadflux":{"id":"udon/hashstudiosadflux","title":"Hash Studios AdFlux","description":"Crafted by Hash Studios for UdonSharp worlds, this Unity Poster Prefab encapsulates our dedication to innovation, supreme quality, and fluid user experiences. This guide will walk you through the installation process for Hash Studios AdFlux.","sidebar":"tutorialSidebar"},"udon/hashstudiosdoorsys":{"id":"udon/hashstudiosdoorsys","title":"Hash Studios DoorSys","description":"Hash Studios DoorSys is a sleek, user-friendly UdonSharp prefab that offers creators the ability to set custom passcodes and create whitelists, ensuring your virtual reality worlds remain secure and accessible to those you choose.","sidebar":"tutorialSidebar"},"udon/hashstudiosplayerscanner":{"id":"udon/hashstudiosplayerscanner","title":"Hash Studios Player Scanner","description":"Hash Studios\' Player Scanner is a UdonSharp Unity Prefab tool detecting player presence in specified areas and showcasing it on a UI menu.","sidebar":"tutorialSidebar"},"udon/hashstudiosportalpicker":{"id":"udon/hashstudiosportalpicker","title":"Hash Studios Portal Picker","description":"Meet Hash Studios Portal Picker, a Unity UdonSharp Prefab. This tool streamlines virtual navigation by allowing users to select worlds, view key details, and create portals for easy access. A significant advancement for world creation, it consolidates world information and enhances interconnectivity.","sidebar":"tutorialSidebar"},"udon/hashstudiosseasonchanger":{"id":"udon/hashstudiosseasonchanger","title":"Hash Studios Season Changer","description":"Hash Studios\' Season Changer is a Unity Prefab designed for UdonSharp worlds. This versatile tool lets you schedule automatic changes to your virtual environments based on seasons or holidays. Just select the objects you want to toggle on or off and set the dates. As the year progresses, your world will dynamically update, bringing a new level of immersion and realism to your creations.","sidebar":"tutorialSidebar"},"udon/hashstudiossimulogo":{"id":"udon/hashstudiossimulogo","title":"Hash Studios SimuLogo","description":"Hash Studios SimuLogo is an UdonSharp Unity Prefab that presents your world logo before you, either a few seconds after your initial spawn, or when you step into a trigger collider. Hash Studios SimuLogo is a Unity prefab tool that detects a player\'s spawn or entry into a certain area and promptly displays the world logo.","sidebar":"tutorialSidebar"},"udon/hashstudiostranslate":{"id":"udon/hashstudiostranslate","title":"Hash Studios Translate","description":"Hash Studios Translate is a powerful and user-friendly translation tool, specifically designed for developers to effortlessly integrate multilingual support into their applications and projects. This guide will walk you through the installation process for Hash Studios Translate.","sidebar":"tutorialSidebar"},"udon/hashstudioswater":{"id":"udon/hashstudioswater","title":"Hash Studios Water","description":"Hash Studios Water is a developer tool that makes it easy for world creators to mimic the vision of being underwater. This guide will walk you through the installation process for Hash Studios Water.","sidebar":"tutorialSidebar"},"udon/hashstudiosworlddisclaimer":{"id":"udon/hashstudiosworlddisclaimer","title":"Hash Studios World Disclaimer","description":"Hash Studios World Disclaimer is a dynamic Unity Udon prefab designed for virtual world creators and event hosts. It offers a seamless way to display tailored disclaimers or important messages to players upon entry. With customizable features like head tracking, movement control, collider management, avatar-based sizes, in-game activation, and menu design, it ensures an immersive, yet informative experience tailored to each world\'s unique needs.","sidebar":"tutorialSidebar"},"udon/pargui":{"id":"udon/pargui","title":"ParGUI","description":"ParGUI is the ultimate game-changer for your local-world experiences, allowing users to customize their in-game experiences like never before. This guide will walk you through the installation process for ParGUI.","sidebar":"tutorialSidebar"}}}}')}}]);